import ExerciseCard from "../ExerciseActivity/ExerciseActivity"
import NewActivityForm from "../NewActivityForm/NewActivityForm"
import "./Exercise.css"

export default function Exercise({ user, addExerciseActivity, exerciseEntries, error, isFetching}) {
  console.log("exercise entries (exercise.js file)", exerciseEntries)
  return (
    <div className="exercisePage">
      {user?.email ? (
                <>
                  <h1> Exercise Feed </h1>
                  {/* <NewActivityForm user={user} addPost={addExerciseActivity} />  */}

                  {/* change the id names for each activity entry to "id" */}
                  <div className="feed">
                    {error ? <h2 className="error">{error}</h2> : null}
                    {isFetching ? <h2>Loading...</h2> : null}
                    {exerciseEntries?.map((activityItem) => (
                      <ExerciseActivity activity={activityItem} key={activityItem.id} user={user} />
                    ))}
                  </div>
                </>
              ) : (
                <>
                  <h1 className="unauthenticatedTitle"> Log in to see this tracked activity.</h1>
                </>
       )}
    </div>
  )
}
